import React from 'react';

import {ArticlePageController} from './ArticlePageController';
import {
    DivMainContainer,
    DivMainContainerInner,
    DivMainBody,
    DivMainLeft,DivMainLeftInner,
    DivMainRight,
    Header,HeaderImage,HeaderContent,
    DivAuthorContainer,DivAuthorImage,DivAuthorInfo,ReleaseDate,

    Title,
    CategoryContainer,
    Alink,AButton,

    DivMainContainerBody,
    ListItemRow
}
    from './ArticlePageElement';

import {DefaultColor} from '../../components/config';

import {ListItemSmall} from '../../components/Items';

class ArticlePage extends ArticlePageController {

    render() {
        let article = this.state.detail;
        console.log(article);


        let datas = this.state.articles.map((element,index)=>{
            return (<ListItemRow key={"key"+index}>
                    {
                        element.map((elm,i)=>{
                            return (<ListItemSmall item={elm} key={"listiemsmall"+i} />)
                        })
                    }
                </ListItemRow>);
        });
        // l


        return (
            <DivMainContainer>
                <DivMainContainerInner>
                    <Header>  
                        <HeaderImage>
                            <img src="media1.png" width="100%" />
                        </HeaderImage> 
                        <HeaderContent>
                            <Title>Docker Zero To Advanced</Title>
                            <CategoryContainer>
                                <AButton>Dokcer</AButton>
                                <AButton marginLeft="20px">AWS</AButton>
                            </CategoryContainer>
                            <DivAuthorContainer>
                                <DivAuthorImage>
                                    <img src="m2.png" width="100%" />
                                </DivAuthorImage>
                                <DivAuthorInfo>
                                    <label>Author : Aung Kyaw Nyunt</label>
                                    <ReleaseDate>March, 22, 2022</ReleaseDate>
                                </DivAuthorInfo>
                            </DivAuthorContainer>
                        </HeaderContent>
                    </Header>


                </DivMainContainerInner>

                <DivMainContainerBody>
                    <DivMainBody>
                        <DivMainLeft>
                            <DivMainLeftInner>
                                left
                            </DivMainLeftInner>
                        </DivMainLeft>
                        <DivMainRight>
                            right
                        </DivMainRight>
                    </DivMainBody>
                </DivMainContainerBody>



            </DivMainContainer>
        );
    }
}



export {ArticlePage};
